pragma solidity >=0.4.21 <0.6.0;

import './Patient.sol';
import './ContractFactory.sol';

contract Interaction {

  enum PaymentEvents {
    USER_PAID_FOR_ARRENGEMENT,
    PAYMENT_SUCCESS,
    WRONG_PAYMENT_CODE,
    NOT_ENOUGH_MONEY,
    TRIES_LIMIT_EXCIDED
  }

  event RequestWriteHistory(
    address patient,
    address doctor,
    bytes32[] entry
  );

  event EntryAddedByDoctor(
    address patient,
    address doctor,
    bytes32[] entry
  );

  event PaymentEvent(
    address patient,
    address doctor,
    PaymentEvents eventType
  );

  address owner;
  mapping(address => uint) private balances;
  ContractFactory private contractFactory;

  constructor() public {
    owner = msg.sender;
  }

  modifier onlyOwner() {
    if (msg.sender == owner) _;
  }

  function setContractFactory(address _contractFactoryAddress) public onlyOwner {
    contractFactory = ContractFactory(_contractFactoryAddress);
  }

  function makeArrangementRequest(
    address _doctor,
    bytes32 _writeAccessCodeFirstPart,
    bytes32 _writeAccessCodeSecondPart,
    bytes32 _paymentCodeFirstPart,
    bytes32 _paymentCodeSecondPart
  ) public payable {

    address patientContractAddress = contractFactory.getContractAddress(msg.sender);
    Patient patient = Patient(patientContractAddress);
    patient.setCodes( _doctor,
      _writeAccessCodeFirstPart,
      _writeAccessCodeSecondPart,
      _paymentCodeFirstPart,
      _paymentCodeSecondPart);

    balances[msg.sender] += msg.value;
    emit PaymentEvent(msg.sender, _doctor, PaymentEvents.USER_PAID_FOR_ARRENGEMENT);
  }

  function getPayment(
    address _patient,
    uint _price,
    bytes32 _codeFirstPart,
    bytes32 _codeSecondPart) public {
    if (balances[_patient] >= _price) {
      address patientContractAddress = contractFactory.getContractAddress(_patient);
      Patient patient = Patient(patientContractAddress);
      bool successCheck = patient.checkPaymentCode(msg.sender, _codeFirstPart, _codeSecondPart);

      if (successCheck) {
        balances[_patient] -= _price;
        msg.sender.transfer(_price);
        emit PaymentEvent(_patient, msg.sender, PaymentEvents.PAYMENT_SUCCESS);
      } else {
        emit PaymentEvent(_patient, msg.sender, PaymentEvents.WRONG_PAYMENT_CODE);
      }
    } else {
      emit PaymentEvent(_patient, msg.sender, PaymentEvents.NOT_ENOUGH_MONEY);
    }
  }

  function emitPaymentTriesLimitEvent(address _patient, address _doctor) public {
    emit PaymentEvent(_patient, _doctor, PaymentEvents.TRIES_LIMIT_EXCIDED);
  }

  function addEntryRequest(
    address _patient,
    bytes32[] memory _entry,
    bytes32 _codeFirstPart,
    bytes32 _codeSecondPart) public {

    address patientContractAddress = contractFactory.getContractAddress(_patient);
    Patient patient = Patient(patientContractAddress);
    bool response = patient.addEntryRequest(msg.sender, _entry, _codeFirstPart, _codeSecondPart);
    if (response == false) {
      emit RequestWriteHistory(_patient, msg.sender, _entry);
    } else {
      emit EntryAddedByDoctor(_patient, msg.sender, _entry);
    }
  }

  function addEntryRequest(address _patient, bytes32[] memory _entry) public {
    addEntryRequest(_patient, _entry, 0, 0);
  }

}
